import React from "react";
import Grid from "@material-ui/core/Grid";

import AppHeader from "../components/AppHeader"

export default function Home() {
  return (
    <Grid contanier direction="column" alignItems="center">
      <Grid item>
        <AppHeader />
      </Grid>
      <Grid item>
        <h1>Home Page</h1>
      </Grid>
    </Grid>
  );
}
